import React, { useEffect } from "react";
import { AppBar, Grow, Button, Typography, Toolbar, Card, CardContent, CardMedia, CssBaseline, Grid, Container } from '@material-ui/core';
import useStyles from './styles';
import Posts from './components/Posts/Posts.js';
import Form from './components/Form/Form.js';

import { useDispatch } from 'react-redux';
import { getPosts } from './actions/posts';

const App = () => {
    const classes = useStyles();
    const dispatch = useDispatch();

    useEffect(() => {
        // dispatch an action
        dispatch(getPosts());
    }, [dispatch]);

    return (
        <>
        <main>
        <Container maxwidth="lg">
            <AppBar className={classes.appBar} position='static' color='inherit'>
                <Typography className={classes.heading} variant='h2' align='center'>FoodFinder</Typography>
                <img className={classes.image} src='https://source.unsplash.com/random' alt="memories" height='60'/>
            </AppBar>
            <Grow in>
                <Container>
                    <Grid container justifyContent='space-between' alignitems='stretch' spacing={3}>
                        <Grid item xs={12} sm={7}>
                            <Posts />
                        </Grid>
                        <Grid item xs={12} sm={4}>
                            <Form />
                        </Grid>
                    </Grid>
                </Container>
            </Grow>

        </Container>
        </main>
                    <footer className={classes.footer}>
                <Typography variant='h6' align='center' gutterBottom>
                    Yuh get sum free food don't waste
                </Typography>
                <Grid container justifyContent="center">
                    <Button align='center'>
                        About
                    </Button>
                </Grid>
            </footer>
            </>
    )
};

export default App;





